EffectiveDate_Year_E_1.query:
q = load "${App.Datasets.Insurance_Policy.FullyQualifiedName}";
q = filter q by date('EffectiveDate_Year', 'EffectiveDate_Month', 'EffectiveDate_Day') in ["1 month ago".."current month"];
result = group q by ('EffectiveDate_Year', 'EffectiveDate_Month');
result = foreach result generate q.'EffectiveDate_Year' + "~~~" + q.'EffectiveDate_Month' as 'EffectiveDate_Year~~~EffectiveDate_Month', sum(q.'GrossWrittenPremium') as 'A';
result = group result by 'EffectiveDate_Year~~~EffectiveDate_Month';
result = foreach result generate 'EffectiveDate_Year~~~EffectiveDate_Month', first(A) as 'A', coalesce((sum(A) - sum(sum(A)) over ([-1..-1] partition by all order by ('EffectiveDate_Year~~~EffectiveDate_Month')))/(sum(sum(A)) over ([-1..-1] partition by all order by ('EffectiveDate_Year~~~EffectiveDate_Month'))),0) as 'ChangeOfGWP';
result = order result by ('EffectiveDate_Year~~~EffectiveDate_Month' desc);
result = limit result 2000;

EffectiveDate_Year_E_10.query:
q = load "${App.Datasets.Insurance_Policy.FullyQualifiedName}";
q = filter q by date('EffectiveDate_Year', 'EffectiveDate_Month', 'EffectiveDate_Day') in ["1 month ahead".."3 months ahead"];
q_A = filter q by 'ClaimsBucket' == "0 - 1 Claims";
q_B = filter q by 'ClaimsBucket' == "2 - 3 Claims";
q_C = filter q by 'ClaimsBucket' == "4 - 5 Claims";
q_D = filter q by 'ClaimsBucket' == "6 or More Claims";
result = group q_A by 'EffectiveDate_Month' full, q_B by 'EffectiveDate_Month' full, q_C by 'EffectiveDate_Month' full, q_D by 'EffectiveDate_Month';
result = foreach result generate coalesce(q_A.'EffectiveDate_Month', q_B.'EffectiveDate_Month', q_C.'EffectiveDate_Month', q_D.'EffectiveDate_Month') as 'EffectiveDate_Month', avg(q_A.'PredictedDistribution') as 'AvgDist_0_1_claims', avg(q_B.'PredictedDistribution') as 'AvgDist_2_3_claims', avg(q_C.'PredictedDistribution') as 'AvgDist_4_5_claims', avg(q_D.'PredictedDistribution') as 'AvgDist_gt_5_claims';
result = order result by ('EffectiveDate_Month' asc);
result = foreach result generate (
    case 'EffectiveDate_Month'
    when  "01" then "January"
    when  "02" then "February"
    when  "03" then "March"
    when  "04" then "April"
    when  "05" then "May" 
    when  "06" then "June" 
    when  "07" then "July" 
    when  "08" then "August" 
    when  "09" then "September" 
    when  "10" then "October" 
    when  "11" then "November" 
    when  "12" then "December"  
    else "N/A" end) as 'EffectiveDate_Month', 'AvgDist_0_1_claims' as '0-1 Claims', 'AvgDist_2_3_claims' as '2-3 Claims', 'AvgDist_4_5_claims' as '4-5 Claims', 'AvgDist_gt_5_claims' as '6 or more Claims';

